import React from 'react';
import logo from './logo.svg';
import './App.css';
import UserList from './components/user.js'

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      'users': []
    }
  }

  componentDidMount() {
    const users = [
      {
        'username': 'Fedor_Dost',
        'first_name': 'Фёдор',
        'last_name': 'Достоевский',
        'email': 'fedordost@mail.ru'
      },
      {
        'username': 'sasha_Grin',
        'first_name': 'Александр',
        'last_name': 'Грин',
        'email': 'SashaGrin@yandex.ru'
      },
    ]
    this.setState(
      {
        'users': users
      }
    )
  }


  render() {
    return (
      <div>
        <UserList users={this.state.users} />
      </div>
    )
  }

}
export default App;
